//16进制字符串转[]byte
func HexToBye(hex string) []byte {
    length := len(hex) / 2
    slice := make([]byte, length)
    rs := []rune(hex)

    for i := 0; i < length; i++ {
        s := string(rs[i*2 : i*2+2])
        value, _ := strconv.ParseInt(s, 16, 10)
        slice[i] = byte(value & 0xFF)
    }
    return slice
}
